CREATE TABLE WEB_DBA.T_CUS_RECORD_INFO
(
    ROW_ID int PRIMARY KEY NOT NULL GENERATED ALWAYS AS IDENTITY(START WITH 1 INCREMENT BY 1),
    CHANNEL char(2) DEFAULT ' ' NOT NULL,
    MCHNTCD char(15) DEFAULT ' ' NOT NULL,
    MCHNTNM varchar(50) DEFAULT '' NOT NULL,
    CUSTOM_TYPE char(2) DEFAULT ' ' NOT NULL,
    PAYER_MCHNT_ID varchar(30) DEFAULT '' NOT NULL,
    PAYER_MCHNT_NM varchar(50) DEFAULT '' NOT NULL,
    BUSI_PLAT_ID varchar(30),
    GZGJ_MCHNT_CODE varchar(30),
    CREATETM timestamp DEFAULT CURRENT TIMESTAMP NOT NULL,
    UPDATETM timestamp DEFAULT CURRENT TIMESTAMP NOT NULL
);
